/sup><div>(2)  Mg<sup>2+</sup></div><div>(3)  K<sup>+</sup></div><img src=\"paste-418209555546115.jpg\" /><img src=\"paste-418261095153667.jpg\" /><img src=\"paste-418488728420355.jpg\" />What antiviral is always administered with Probenecid?Cidofovir<img src=\"paste-419051369136131.jpg\" />How does Probenecid protect the kidney from Cidofovir?Inhibits tubular secretion<div><i><sup><br /></sup></i></div><div><i><sup>( Reduced intra-lumenal Cidofovir concentration  Reduced toxicity)</sup></i></div><img src=\"paste-419047074168835.jpg\" /><img src=\"paste-419605419917315.jpg\" /><img src=\"paste-407652525932547.jpg\" /><img src=\"paste-407699770572803.jpg\" /><img src=\"paste-305286275399683.jpg\" /><img src=\"paste-17046725197827.jpg\" /><img src=\"paste-14950781157379.jpg\" />8.2 - Ganciclovir, valganciclovir, foscarnet, cidofovir<img src=\"paste-394359602151427.jpg\" />",
